import React from 'react';

//import images
import WomanImg from 'src/img/home/woman.png'

//import link
import {Link} from'react-router-dom'

const Home = () => {
  return <section className='section bg-blue-200'>
    <div className='container mx-auto h-full relative'>
      {/* text and image wrapper */}
      <div flex flex-col justify-center>

        {/* text */}
        <div className='w-full pt-36 pb-14 lg:pt-0 lg:pb-0 lg:w-auto z-10 lg:absolute flex flex-col justify-center items-center lg:items-start'>
          <h1 className='h1'>Photographer <br /> & film maker</h1>
          <p className='text-[26px] lg:text-[36px] font-primary mb-4 lg:mb-12'>Los Angeles</p>
          <Link to = {'/contact'} className='btn mb-[30px]'>Hire me</Link>
        </div>
        {/* image */}
        <div >
          <img src = {WomanImg} alt = "" />
        </div>
      </div>
    </div>
  </section>;
};

export default Home;
